import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';

const User = ({user}) => {
    return (
        <tr>
            <br/>
            <td>
                {user.username}
            </td>
            <td>
                {user.first_name}
            </td>
            <td>
                {user.last_name}
            </td>
            <td>
                {user.email}
            </td>
        </tr>
    )
}

const UserList = ({users}) => {
    return (
        <table className="header_info">
            <th>
                User name
            </th>
            <th>
                First name
            </th>
            <th>
                Last name
            </th>
            <th>
                Email
            </th>
            <div className="header">
                {users.map((user_string) => <User user={user_string}/>)}
            </div>
        </table>
    )
}
export default UserList
